- input: "TEXT\x1CC00437293\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's Request for Additional Information dated 12/23/2008 regarding
    the 30 Day Post-General Report.  1) Regarding Missing 48-hour notices for Rita
    Ledbetter, the Human Rights Campaign, and USA PAC.  The contribution of $1,200
    was actually a re-designation from James Ledbetter to Rita Ledbetter.  The original
    contribution from James Ledbetter was reported on a 48-hour notice on 10/28.  This
    amendment shows the re-designation correctly.  The Human Rights Campaign in-kind
    contribution was for payroll and should have been reported on 11/4 at the completion
    of the work just as any other employee would be reported for payroll.  This amendment
    properly reports the in-kind salary on the proper date.  The USA PAC contribution
    was disclosed on the 48-hour notice filed on 10/31, 6th entry on the second page.
    \ 2)  Regarding the contribution from James Ledbetter on 10/28 - as mentioned
    above the committee inadvertently reported the re-designation to Rita Ledbetter
    incorrectly.  This amendment properly discloses the re-designation.  -  In addition
    while researching this amendment the committee discovered a duplicate donor in
    the database - Jonathon Rothschild was reported as un-itemized giving $200.  This
    amendment properly discloses the correct aggregate amount itemized."
